import React from "react";
import ReactDOM from "react-dom";

function MyFunc()
{return (
    <div>
    <ol>
        <li>Hello, I'm Odered</li>
        <li>Even I'm ordered!</li>
    </ol>
    <ul>
        <li>I'm First item</li>
        <li>I'm second</li>
        <li>I'm Third</li>
    </ul>
    </div>

)}

ReactDOM.render(
<MyFunc />,document.getElementById("root"));
